import gql from "graphql-tag";

export const GET_TEAMS = gql`
  query getTeams {
    teams {
      id
      name
      users {
        fullName
      }
    }
  }
`;

export const GET_TEAM = gql`
  query getTeams($id: ID!) {
    team(id: $id) {
      id
      name
      users {
        fullName
      }
    }
  }
`;
